import base64
from io import BytesIO
import pygame
from PIL import Image

str = b''
byte_data = base64.b64decode(str)
image_data = BytesIO(byte_data)
lkw_leerImage = Image.open(image_data)

# Konvertieren des Bildes in ein unterstütztes Format
if lkw_leerImage.mode != 'RGB':
    pil_image = lkw_leerImage.convert('RGB')
lkw_leerImage.save('temp.bmp')

# Laden des Bildes in ein Surface-Objekt
lkw_leerImage = pygame.image.load('temp.bmp').convert_alpha()

